  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains data from predator
  disease sampling in Montana for the reintroduction of black-footed ferrets at Charles
  M. Russell National Wildlife Refuge. Sampling occurred in south Phillips county
  and Fort Belknap Indian Reservation. Coyotes, foxes and badgers were collected and
  tested for canine distemper, lepto, sylvatic plague, tularemia, and toxoplasma.
  \ Sampling occurred on January 19-27, 1993, February 1-5 1994, August 1994 and February
  1995.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
